import React from "react";
import "./CategoryList.css"; // スタイル適用

const categories = [
  "公開予定の映画",
  "上映中の映画",
  "話題の映画",
  "評価の高い映画",
];

const CategoryList = () => {
  return (
    <ul className="category-list">
      {categories.map((category, index) => (
        <li key={index} className="category-item">{category}</li>
      ))}
    </ul>
  );
};

export default CategoryList;
